query TID_TournamentQuery(
  $TID: String!
  $commander: String
  $showStandings: Boolean!
  $showBreakdown: Boolean!
  $showBreakdownCommander: Boolean!
) {
  tournament(TID: $TID) {
    ...TID_TournamentPageShell
    entries @include(if: $showStandings) {
      id
      ...TID_EntryCard
    }
    breakdown @include(if: $showBreakdown) {
      commander {
